import './App.css';
import {
  createBrowserRouter,
} from "react-router-dom";
import Home from './components/pages/home/home';
import Club from './components/pages/club/club';

const App = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
    children: [
      {
        path: "/club/:clubId",
        element: <Club />,
      },
    ],
  },
]);


export default App;
